import React from 'react'
import {Container} from 'react-bootstrap'

const BottomNote = () => {
    return (
        <div style={{"padding-bottom": "4vh", "padding-top": "3vh"}}>
            <h6 className="text-center">
                Note: This Club Invitation is only Extended to Those Who Current Attend LHS.
            </h6>
        </div>
    )
}

export default BottomNote
